import React from "react";
import ReactDOM from "react-dom/client";
// import { ReactDOM } from "react";

function App() {
  return (
    <div>
      <Header />
      <Item />
      <Item />
      <Footer />
    </div>
  );
}

function Item() {
  return (
    <div id="item">
      <h2>Folder</h2>
      <img
        src="https://godsgraceproducts.in/wp-content/uploads/2023/09/CF-1367-All-1.jpg"
        width={180}
        height={180}
        alt=""
      ></img>
    </div>
  );
}

function Header() {
  return (
    <div id="header">
      <h1>God's Grace Distributions</h1>
    </div>
  );
}
function Catalog() {}
function Footer() {
  return (
    <div id="footer">
      <p>We're currently open!</p>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
